import React from 'react'

class Usernames extends React.Component {
    render() {
        return (
            <>
            <h1>Unavailable</h1>
            <h2>You do not have access to the usernames.
          <br/> You must figure the usernames out yourself</h2>
          </>
        )
    }
}

export default Usernames
